}
","keccak256":"0x8bf2c545bb8a15ef60202df1e4e04ae5917367ecb277fc2bbdd5335cd33559e1"},"contracts/compound/CToken.sol":{"content":"// SPDX-License-Identifier: GPL-3.0-or-later
